                function getTable(tblname, data) {
                var column = '';
                        var i = 0;
                        var div = "<div class=\"table-responsive\">";
                        div = "<table id=\"" + tblname + "\" class=\"table table-bordered table-striped table-hover display row-border hover order-column\" cellspacing=\"10\" width=\"100%\">";
                        //Create header
                        div += "<thead>";
                        div += "<tr class=\"primary text-center\" >";
                        for (var key in data[i]) {
                column += "<th>" + key + "</th>";
                }
                div += column;
                        div += "</tr></thead>";
                        //Create Rows
                        div += "<tbody>";
                        $.each(data, function (key, value) {
                        div += "<tr data-toggle='tooltip' title='HAGA DOBLE CLIC PARA EDITAR' >";
                                $.each(value, function (key, value) {
                                div += "<td>" + value + "</td>";
                                });
                                div += "</tr>";
                        });
                        div += "</tbody>";
                        //Create Footer
                        div += "<tfoot>";
                        div += "<tr class=\"primary text-center\">";
                        div += column;
                        div += "</tr></tfoot>";
                        div += "</table>";
                        div += "</div>";
                        return div;
                }
        function onNotify(span, message, type) {
        if (type === "danger") {
        beep();
        }
        if (type === "success"){
        beeds();
        }
        $.notify({
        icon: "media/logo.png",
                title: span,
                message: message
        }, {
        type: type,
                z_index: 3031,
                placement: {
                from: "top",
                        align: "center"
                }
        }, {
        animate: {
        enter: 'animated bounceIn',
                exit: 'animated bounceOut'
        }
        });
        }
        function getExt(filename) {
        var dot_pos = filename.lastIndexOf(".");
                if (dot_pos === - 1)
                return "";
                return filename.substr(dot_pos + 1).toLowerCase();
        }

